# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Flask~Subclass
    - blaze
    - Member[server].Member[server].Member[FlaskWithExceptionFormatting]
  - - io.StringIO~Subclass
    - blaze
    - Member[compatibility].Member[StringIO]
  - - pickle~Alias
    - blaze
    - Member[compatibility].Member[pickle]
  - - pickle~Alias
    - blaze
    - Member[server].Member[serialization].Member[pickle_module]
